/**************************************
作用：反校正，真实图到原图的变换
参数：原图的纵坐标，横坐标，平移距离
返回：平移一定距离的原图横坐标
**************************************/
uint8 fanjiaozheng_x(int j,int i,int a)//x方向反校正
{
  int temp_x;
  int x=(int)real_x[j][i]+a;
  int y=(int)real_y[j][i];
  y=-1*y;
//  if(x<left_init)
//    return left_init;
//  if(x>right_init)
//    return right_init;
//  
  temp_x=(int)((a2*(x-103)/50+b2*(y+52)/50+e2)/(1+v2*(y+52)/50))+1;//最后的1为反校正误差调整
  if(temp_x>159)
    temp_x=159;
  if(temp_x<0)
    temp_x=0;
  return (uint8)temp_x;
}
/**************************************
作用：反校正，真实图到原图的变换
参数：原图的纵坐标，横坐标，平移距离
返回：平移一定距离的原图纵坐标
**************************************/
uint8 fanjiaozheng_y(int j,int i,int a)//y方向反校正
{
  int temp_y;
  int x=(int)real_x[j][i]+a;
  int y=(int)real_y[j][i];
//  if(x<left_init)
//    return left_init;
//  if(x>right_init)
//    return right_init;
//  
  temp_y=(int)((c2*(x-103)/50+d2*(y+51)/50+f2)/(1+v2*(y+51)/50))+1;//最后的1为反校正误差调整
  if(temp_y>255)
    temp_y=255;
  if(temp_y<0)
    temp_y=0;
  return (uint8)temp_y;
}
